import React from 'react';
import styled from 'styled-components'
import ToolBar from './Pages/ToolBar'
import Image from './Pages/Image'
import About from './Pages/About';

const OutsideContainer = styled.div`
`

function App() {
  return (
  <>
   <ToolBar></ToolBar>
   <OutsideContainer>
     <Image></Image>
     <About></About>
   </OutsideContainer>
  </>
  );
}

export default App;
